import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Link, Redirect } from "react-router-dom";
import lightGreen from '@material-ui/core/colors/lightGreen';

import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import TextField from '@material-ui/core/TextField';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';
import FormControl from '@material-ui/core/FormControl';


import Button from '@material-ui/core/Button';
import Fab from '@material-ui/core/Fab';
import AddIcon from '@material-ui/icons/Add';
import Icon from '@material-ui/core/Icon';
import DeleteIcon from '@material-ui/icons/Delete';
import NavigationIcon from '@material-ui/icons/Navigation';

class NewTrackerDialog extends Component {

    constructor(props) {
      super(props)
      this.state = {
        companyName: '',
        positionTitle: ''
      }
    }

    handleChange = prop => event => {
      this.setState({ [prop]: event.target.value });
    };

    render() {

        return (
          <div className="App">
              <DialogTitle id="form-dialog-title">Create an Application Tracker</DialogTitle>
              <form>
                <FormControl required={true}>
                  <InputLabel htmlFor="component-simple">Company Name</InputLabel>
                  <Input id="component-simple" value={this.state.newUsername} onChange={this.handleChange('newUsername')}/>
                </FormControl>
                <FormControl required={true}>
                  <InputLabel htmlFor="component-simple">Position I'm Applying For</InputLabel>
                  <Input id="component-simple" value={this.state.newUsername} onChange={this.handleChange('newUsername')}/>
                </FormControl>

              </form>
         </div>
        );

    }
  }

  export default NewTrackerDialog;
